import React from "react";
import "./AdminSidebar.css";

const AdminSidebar = () => {
  return (
    <div className="adminSidebar">
      <ul
        id="nav-mobile"
        class="sidenav"
        style={{ transform: "translateX(0px)" }}
      >
        <li class="bold">
          <a href="mobile.html" class="waves-effect waves-teal">
            Mobile
          </a>
        </li>
        <li class="bold">
          <a href="showcase.html" class="waves-effect waves-teal">
            Showcase
          </a>
        </li>
        <li class="bold">
          <a href="themes.html" class="waves-effect waves-teal">
            Themes
          </a>
        </li>
      </ul>
    </div>
  );
};

export default AdminSidebar;
